const DUMMY_EVENTS = [
  {
    id: 'e1',
    title: 'some event',
  },
  {
    id: 'e2',
    title: 'some event',
  },
  {
    id: 'e3',
    title: 'some event',
  },
  {
    id: 'e4',
    title: 'some event',
  }
]


export const EventsPage = () => {
  return(
   <>
   <h1>EventsPage</h1>
   <ul>
    {DUMMY_EVENTS.map(item => {
      return (
        <li key={item.id}>{item.title}</li>
      )
    })}
   </ul>
   </>
)}
